const TIMER_ICON = "data:image/x-icon;base64,";
const PLUS_ICON = "data:image/x-icon;base64,";
const MINUS_ICON = "data:image/x-icon;base64,";

const CIRCLE_ICON = "data:image/x-icon;base64,";

function showToast(window, message) {
  window.NativeWindow.toast.show(message, "short");
}

function getPlayingVideos(document) {
  let videos = Array.prototype.slice.call(document.getElementsByTagName('video'));

  let iFrames = document.getElementsByTagName('iframe');
  if (iFrames.length > 0) {
    for (let i = 0; i < iFrames.length; i++) {
      videos = videos.concat(Array.prototype.slice.call(iFrames[i].contentDocument.getElementsByTagName('video')));
    }
  }
  return videos.filter(function (video) {
    return !video.paused;
  });
}

function makeDynamicPlaybackRateFunction(playbackRate) {
  return function (video) {
    video.playbackRate += playbackRate;
    video.defaultPlaybackRate = video.playbackRate;
  };
}

function makeFixedPlaybackRateFunction(playbackRate) {
  return function (video) {
    video.playbackRate = playbackRate;
    video.defaultPlaybackRate = video.playbackRate;
  };
}

function makeSetPlaybackRateFunction(window, setRateFunction) {
  return function () {
    let document = window.BrowserApp.selectedBrowser.contentWindow.document;
    let videos = getPlayingVideos(document);
    if (videos.length === 0) {
      showToast(window, "No playing video");
      return;
    }
    if (videos.length > 1) {
      showToast(window, "More than one playing video");
      return;
    }
    setRateFunction(videos[0]);
    showToast(window, videos[0].playbackRate + "X");
  };
}


let parentID = null;

function loadIntoWindow(window) {
  if (!window)
    return;

  parentID = window.NativeWindow.menu.add({
    name: "Video Speed",
    icon: TIMER_ICON
  });

  window.NativeWindow.menu.add({
    name: "Max",
    icon: PLUS_ICON,
    //5.0X seems to be the highest value that can be set
    callback: makeSetPlaybackRateFunction(window, makeFixedPlaybackRateFunction(5.0)),
    parent: parentID
  });

  window.NativeWindow.menu.add({
    name: "1+",
    icon: PLUS_ICON,
    callback: makeSetPlaybackRateFunction(window, makeDynamicPlaybackRateFunction(1.0)),
    parent: parentID
  });

  window.NativeWindow.menu.add({
    name: "0.25+",
    icon: PLUS_ICON,
    callback:makeSetPlaybackRateFunction(window, makeDynamicPlaybackRateFunction(0.25)),
    parent: parentID
  });

  window.NativeWindow.menu.add({
    name: "1X",
    icon: CIRCLE_ICON,
    callback: makeSetPlaybackRateFunction(window, makeFixedPlaybackRateFunction(1.0)),
    parent: parentID
  });

  window.NativeWindow.menu.add({
    name: "0.25-",
    icon: MINUS_ICON,
    callback: makeSetPlaybackRateFunction(window, makeDynamicPlaybackRateFunction(-0.25)),
    parent: parentID
  });

  window.NativeWindow.menu.add({
    name: "1-",
    icon: MINUS_ICON,
    callback: makeSetPlaybackRateFunction(window, makeDynamicPlaybackRateFunction(-1.0)),
    parent: parentID
  });

}

function unloadFromWindow(window) {
  if (!window)
    return;

  window.NativeWindow.menu.remove(parentID);
}


/**
 * bootstrap.js API from developer.mozilla.org/en-US/docs/Extensions/Mobile/Initialization_and_Cleanup
 */
var windowListener = {
  onOpenWindow: function (aWindow) {
    // Wait for the window to finish loading
    let domWindow = aWindow.QueryInterface(Ci.nsIInterfaceRequestor).getInterface(Ci.nsIDOMWindowInternal || Ci
      .nsIDOMWindow);
    domWindow.addEventListener("UIReady", function () {
      domWindow.removeEventListener("UIReady", arguments.callee, false);
      loadIntoWindow(domWindow);
    }, false);
  },

  onCloseWindow: function (aWindow) {},

  onWindowTitleChange: function (aWindow, aTitle) {}
};

function startup(aData, aReason) {
  // Load into any existing windows
  let windows = Services.wm.getEnumerator("navigator:browser");
  while (windows.hasMoreElements()) {
    let domWindow = windows.getNext().QueryInterface(Ci.nsIDOMWindow);
    loadIntoWindow(domWindow);
  }

  // Load into any new windows
  Services.wm.addListener(windowListener);
}

function shutdown(aData, aReason) {
  // Stop listening for new windows
  Services.wm.removeListener(windowListener);

  // Unload from any existing windows
  let windows = Services.wm.getEnumerator("navigator:browser");
  while (windows.hasMoreElements()) {
    let domWindow = windows.getNext().QueryInterface(Ci.nsIDOMWindow);
    unloadFromWindow(domWindow);
  }
}

function install(aData, aReason) {}

function uninstall(aData, aReason) {}
